import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import {Accordion, Button, Form, Nav, NavDropdown, OverlayTrigger, Popover} from "react-bootstrap";
import logo from '../resources/logo.png';
import theme from "../common/Theme";
import NavbarCollapse from "react-bootstrap/NavbarCollapse";
import NavbarToggle from "react-bootstrap/NavbarToggle";
import Modal from 'react-bootstrap/Modal';
import {Routes, Route, Link, useNavigate} from "react-router-dom";
import {useEffect, useState} from "react";
import AuthService from "../services/auth.service";
import EventBus from "../common/EventBus";
import PersonRoundedIcon from '@mui/icons-material/PersonRounded';
import Image from 'react-bootstrap/Image';

export default function Header({user}) {
    let navigate = useNavigate();

    function logout() {
        AuthService.logout()
        navigate("/");
        window.location.reload();
    }


    const nav = user ? (<Nav>
        <OverlayTrigger
            trigger="click"
            placement="bottom"
            overlay={
                <Popover>
                    <Popover.Header as="h3">{`Log Out`}</Popover.Header>
                    <Popover.Body>
                        Are you going to <strong className="d-inline-block border-danger border border-2 p-1 rounded-2">log
                        out</strong> ?
                        <Button className="alert-danger bt-sm mt-1 " variant="danger" onClick={logout}>
                            Log Out
                        </Button>
                    </Popover.Body>
                </Popover>
            }
        >

            <Button
                variant="light"
                className="d-inline-flex align-items-center btn-sm me-2"
            >
                <PersonRoundedIcon/>
                <span className="ms-1 fw-bold fs-5">{user}</span>
            </Button>

        </OverlayTrigger>
    </Nav>) : (<Nav>
        <Nav.Link href="/login">
            Log in
        </Nav.Link>
        <Nav.Link href="/register">
            Register
        </Nav.Link>
    </Nav>);
    return (
        <>

            <Navbar expand="md" style={{backgroundColor: theme.dark}} variant="dark">

                <Container className="col-12" style={{maxWidth: "none"}}>

                    <Navbar.Brand style={{overflow: "hidden"}}>

                        <img src={logo} alt="fatEar " width="60" className="d-inline-block align-top" style={{
                            marginLeft: 30,
                            position: "relative",
                            left: "-10px",
                            transform: "scale(2.2)"
                        }}/>

                    </Navbar.Brand>

                    <NavbarToggle aria-controls="responsive-navbar-nav"
                                  style={{backgroundColor: theme.peach}}></NavbarToggle>
                    <NavbarCollapse id="responsive-navbar-nav">
                        <Nav className="d-flex m-auto col-4">

                            <Modal show={show} onHide={handleClose}>
                                <Modal.Header closeButton>
                                    <Modal.Title>Modal heading</Modal.Title>
                                </Modal.Header>
                                <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
                                <Modal.Footer>
                                    <Button variant="secondary" onClick={handleClose}>
                                        Close
                                    </Button>
                                    <Button variant="primary" onClick={handleClose}>
                                        Save Changes
                                    </Button>
                                </Modal.Footer>
                            </Modal>
                            {/*<Form className="d-flex col-12">*/}
                            {/*    /!* eslint-disable-next-line react/jsx-no-undef *!/*/}
                            {/*    <Form.Control*/}
                            {/*        type="search"*/}
                            {/*        placeholder="Search"*/}
                            {/*        className="me-3"*/}
                            {/*        aria-label="Search"*/}
                            {/*        style={{minWidth: "150px"}}*/}
                            {/*    />*/}
                            {/*    <Button variant="outline-dark" style={{backgroundColor: theme.peach}}>Search</Button>*/}
                            {/*</Form>*/}
                        </Nav>

                        {nav}

                    </NavbarCollapse>


                </Container>
            </Navbar>


        </>
    );
};
